import './App.css';

function App() {
  return (
    <div className="App">
      <h1>City Mini Guide</h1>
      <div className="row">

      </div>
      <p>Choose City</p>
      <select></select>
      <button type="button">Pharmacies</button>
      <button type="button">Schools&Colleges</button>
      <button type="button">Hospitals</button>
      <button type="button">Doctors</button>
    </div>
  );
}

export default App;
